function App() {
  return (
    <Wrapper>
      {/* <Menu></Menu> */}
      <Landing />
    </Wrapper>
  );
}

export default App;

const Wrapper = styled.div`
  height: 100%;
  margin-bottom: 100px;
`;

const ImageContainer = styled.div`
  display: flex;
  justify-content: center;
  height: 100%;
`;
